window.bookSummaryJSON = "<p><b>Rachel always thought I was wasting my life on the Sinners, but being Prez is all I've ever wanted to be.</b></p> <p>When she tore us apart on her journey to become someone, I let her go. I made sacrifices for her because I knew why she had to prove herself. I just didn't realize that would involve freezing me out for years.</p> <p>Now, she's the best criminal attorney in the Tri-state area, and I'm still Prez—only my world is falling apart. The MC is under scrutiny, our dirty secrets are being laundered in the public eye, and some of my brothers could be facing jail time.</p> <p>Only one woman can stop that from happening—Rachel.</p> <p>She'll fight for my brothers, but will she fight for us?</p> <p><i>Rex</i> is part one of the Last Bachelor Duet, followed by <i>Rachel</i>.</p>"; 
